    content: public EventData(EventChannels channels, EventLevel level, DateTime eventTimestamp, DateTime submissionTimestamp, SenderAuthorization authorization = null, IDictionary<string, string> claims = null, string caller = null, string description = null, string id = null, string eventDataId = null, string correlationId = null, LocalizableString eventName = null, LocalizableString category = null, HttpRequestInfo httpRequest = null, string resourceGroupName = null, LocalizableString resourceProviderName = null, string resourceId = null, LocalizableString resourceType = null, string operationId = null, LocalizableString operationName = null, IDictionary<string, string> properties = null, LocalizableString status = null, LocalizableString subStatus = null, string subscriptionId = null, string tenantId = null)
    content.vb: Public Sub New(channels As EventChannels, level As EventLevel, eventTimestamp As Date, submissionTimestamp As Date, authorization As SenderAuthorization = Nothing, claims As IDictionary(Of String, String) = Nothing, caller As String = Nothing, description As String = Nothing, id As String = Nothing, eventDataId As String = Nothing, correlationId As String = Nothing, eventName As LocalizableString = Nothing, category As LocalizableString = Nothing, httpRequest As HttpRequestInfo = Nothing, resourceGroupName As String = Nothing, resourceProviderName As LocalizableString = Nothing, resourceId As String = Nothing, resourceType As LocalizableString = Nothing, operationId As String = Nothing, operationName As LocalizableString = Nothing, properties As IDictionary(Of String, String) = Nothing, status As LocalizableString = Nothing, subStatus As LocalizableString = Nothing, subscriptionId As String = Nothing, tenantId As String = Nothing)
    parameters:
    - id: channels
      type: Microsoft.Azure.Insights.Models.EventChannels
      description: >-
        the event channels. The regular event logs,

        that you see in the Azure Management Portals, flow through the

        'Operation' channel. Possible values include: 'Admin',

        'Operation', 'Debug', 'Analytics'
    - id: level
      type: Microsoft.Azure.Insights.Models.EventLevel
      description: >-
        the event level. Possible values include:

        'Critical', 'Error', 'Warning', 'Informational', 'Verbose'
    - id: eventTimestamp
      type: System.DateTime
      description: >-
        the occurrence time of event in ISO

        8601 format
    - id: submissionTimestamp
      type: System.DateTime
      description: >-
        the event submission time in ISO

        8601 format. This value should not be confused eventTimestamp. As

        there might be a delay between the occurence time of the event,

        and the time that the event is submitted to the Azure logging

        infrastructure.
    - id: authorization
      type: Microsoft.Azure.Insights.Models.SenderAuthorization
      description: >-
        the authorization used by the user who

        has performed the operation that led to this event.
    - id: claims
      type: System.Collections.Generic.IDictionary{System.String,System.String}
      description: >-
        key value pairs to identify ARM

        permissions.
    - id: caller
      type: System.String
      description: >-
        the email address of the user who has

        performed the operation, the UPN claim or SPN claim based on

        availability.
    - id: description
      type: System.String
      description: the description of the event.
    - id: id
      type: System.String
      description: the resource Id.
    - id: eventDataId
      type: System.String
      description: >-
        the event data Id. This is a unique

        identifier for an event.
    - id: correlationId
      type: System.String
      description: >-
        the correlation Id. The correlation Id

        is shared among the events that belong to the same

        deployment.
    - id: eventName
      type: Microsoft.Azure.Insights.Models.LocalizableString
      description: >-
        the event name. This value should not be

        confused with OperationName. For practical purposes,

        OperationName might be more appealing to end users.
    - id: category
      type: Microsoft.Azure.Insights.Models.LocalizableString
      description: the event category.
    - id: httpRequest
      type: Microsoft.Azure.Insights.Models.HttpRequestInfo
      description: >-
        the HTTP request info. The client IP

        address of the user who initiated the event is captured as part

        of the HTTP request info.
    - id: resourceGroupName
      type: System.String
      description: the resource group name.
    - id: resourceProviderName
      type: Microsoft.Azure.Insights.Models.LocalizableString
      description: >-
        the resource provider

        name.
    - id: resourceId
      type: System.String
      description: the resource uri
    - id: resourceType
      type: Microsoft.Azure.Insights.Models.LocalizableString
      description: the resource type
    - id: operationId
      type: System.String
      description: >-
        It is usually a GUID shared among the

        events corresponding to single operation. This value should not

        be confused with EventName.
    - id: operationName
      type: Microsoft.Azure.Insights.Models.LocalizableString
      description: the operation name.
    - id: properties
      type: System.Collections.Generic.IDictionary{System.String,System.String}
      description: >-
        the property bag that includes details

        about the event.
    - id: status
      type: Microsoft.Azure.Insights.Models.LocalizableString
      description: >-
        the event status. Some typical values are:

        Started, Succeeded, Failed. For more information see:

        https://msdn.microsoft.com/en-us/library/azure/dn931934.aspx
    - id: subStatus
      type: Microsoft.Azure.Insights.Models.LocalizableString
      description: >-
        the event sub status. Most of the time,

        when included, this captures the HTTP status code. For more

        information see:

        https://msdn.microsoft.com/en-us/library/azure/dn931934.aspx
    - id: subscriptionId
      type: System.String
      description: the Azure subscription Id
    - id: tenantId
      type: System.String
      description: the Azure tenant Id
